import React, { useState, useEffect } from "react";

const Planeteers = () => {
  const [planeteers, setPlaneteers] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const response = await fetch("https://api.myjson.com/bins/zyv02");
      const data = await response.json();
      setPlaneteers(data);
    };
    fetchData();
  }, []);

  return (
    <div>
      <h2>Planeteers</h2>
      <ul>
        {planeteers.map((planeteer) => (
          <li key={planeteer.id}>
            {planeteer.name} ({planeteer.element})
          </li>
        ))}
      </ul>
    </div>
  );
};
console.log (Planeteers);

export default Planeteers;
